AddTags.syncDocumentation:
/**<p>Adds one or more tags to a trail, up to a limit of 10. Tags must be unique per trail. Overwrites an existing tag's value when a new value is specified for an existing tag key. If you specify a key without a value, the tag will be created with the specified key and a value of null.</p>
@param addTagsRequest Specifies the tags to add to a trail.
@return Result of the AddTags operation returned by the service.
@throws ResourceNotFoundException This exception is thrown when the specified resource is not found.
@throws CloudTrailARNInvalidException This exception is thrown when an operation is called with an invalid trail ARN. The format of a trail ARN is <code>arn:aws:cloudtrail:us-east-1:123456789012:trail/MyTrail</code>.
@throws ResourceTypeNotSupportedException This exception is thrown when the specified resource type is not supported by CloudTrail.
@throws TagsLimitExceededException The number of tags per trail has exceeded the permitted amount. Currently, the limit is 10.
@throws InvalidTrailNameException This exception is thrown when the provided trail name is not valid. Trail names must meet the following requirements:</p> <ul> <li>Contain only ASCII letters (a-z, A-Z), numbers (0-9), periods (.), underscores (_), or dashes (-)</li> <li>Start with a letter or number, and end with a letter or number</li> <li>Be between 3 and 128 characters</li> <li>Have no adjacent periods, underscores or dashes. Names like <code>my-_namespace</code> and <code>my--namespace</code> are invalid.</li> <li>Not be in IP address format (for example, 192.168.5.4)</li>
@throws InvalidTagParameterException This exception is thrown when the key or value specified for the tag does not match the regular expression <code>^([\\p{L}\\p{Z}\\p{N}_.:/=+\\-@]*)$</code>.
@throws UnsupportedOperationException This exception is thrown when the requested operation is not supported. For example, this exception will occur if an attempt is made to tag a trail and tagging is not supported in the current region.
@throws OperationNotPermittedException This exception is thrown when the requested operation is not permitted.*/

