LookupEvents.syncDocumentation:
/**<p>Looks up API activity events captured by CloudTrail that create, update, or delete resources in your account. Events for a region can be looked up for the times in which you had CloudTrail turned on in that region during the last seven days. Lookup supports five different attributes: time range (defined by a start time and end time), user name, event name, resource type, and resource name. All attributes are optional. The maximum number of attributes that can be specified in any one lookup request are time range and one other attribute. The default number of results returned is 10, with a maximum of 50 possible. The response includes a token that you can use to get the next page of results. </p> <important>The rate of lookup requests is limited to one per second per account. If this limit is exceeded, a throttling error occurs. </important> <important>Events that occurred during the selected time range will not be available for lookup if CloudTrail logging was not enabled when the events occurred.</important>
@param lookupEventsRequest Contains a request for LookupEvents.
@return Result of the LookupEvents operation returned by the service.
@throws InvalidLookupAttributesException Occurs when an invalid lookup attribute is specified.
@throws InvalidTimeRangeException Occurs if the timestamp values are invalid. Either the start time occurs after the end time or the time range is outside the range of possible values.
@throws InvalidMaxResultsException This exception is thrown if the limit specified is invalid.
@throws InvalidNextTokenException Invalid token or token that was previously used in a request with different parameters. This exception is thrown if the token is invalid.*/

